}

{
  "text": "Ketamine hydrochloride was administered intravenously ( at a dose of two milligrams per kilogram of body weight ) in ninety - nine of the patients and intramuscularly ( at a dose of four milligrams per kilogram of body weight ) in the other fifteen .",
