}

{
  "text": "Patency of the airway and independent respiration were maintained in all of the patients .",
  "entities": []
}

{
  "text": "Blood pressure and heart rate remained stable .",
  "entities": []
}

{
  "text": "Minor side effects included nausea ( thirteen patients ) , emesis ( eight of the thirteen patients with nausea ) , clumsiness ( evident as ataxic movements in ten patients ) , and dysphoric reaction ( one patient ) .",
