         "type": "Disease"
    },
    {
        "entity": "nightmares", 
        "type": "Disease"
    }
  ]
}

{
  "text": "CONCLUSIONS : Ketamine reliably , safely , and quickly provided adequate sedation to effectively facilitate the reduction of children ' s fractures in the emergency department at our institution .",
  "entities": [
